var coreMod = angular.module('coreMod', [
    'coreModProvider',
    'ui.state'
  ]).config([
    'coreModProvider',
    '$locationProvider',
    function (coreModProvider, $locationProvider) {
      console.log('coreMod.config');
    }
  ]);
angular.module('coreModProvider', ['coreMod']).constant('coreModConfig', appConfig).provider('coreMod', [
  'coreModConfig',
  function (coreModConfig) {
    console.log('coreMod.provider');
    this.config = coreModConfig;
    console.log(this.config);
    this.getConfig = function () {
      return this.config;
    };
    this.getMod = function (name) {
      return this.config.mod[name];
    };
    this.$get = [
      '$log',
      function ($log) {
      }
    ];
    this.$get.$inject = ['$log'];
  }
]);